import React from 'react';
import './css/friends.css';

const Friends = ({svg1, svg2, svg3 }) => {
    return (
        <div>
            <section>
               <p>Amigos { svg1 } </p>
               <p>Nitro X { svg2 } </p>
               <p>Mensagem Direta </p>
               <div>
                   <div></div>
                   <p>Nome</p>
               </div>
            </section>
        </div>
    )
}

Friends.defaultProps = {
    svg1: <img src="./imgs/boneco-icon.png" alt=""/>,
    svg2: <img src="./imgs/nitro-icon.png" alt=""/>,
}
export default Friends;
